desc:
During your Draw Phase, if you have no cards in your hand, instead of conducting your normal draw: You can banish this card from your GY, then activate 1 of these effects;
● Place 1 "Infernity" card from your Deck on top of your Deck.
● Set 1 "Void" Spell/Trap directly from your Deck.

When this card inflicts battle damage to your opponent: You can activate 1 of these effects;
● Discard 1 random card from their hand.
● Send the top 2 cards of their Deck to the GY.

You can only use the effect of "Gimmick Puppet Egg Head" once per turn. You can discard 1 "Gimmick Puppet" monster, then activate 1 of these effects;
● Inflict 800 damage to your opponent.
● This card's Level becomes 8 until the End Phase.

If you have no Spell/Trap Cards in your Graveyard, you can Special Summon this card (from your hand). After this card was Special Summoned this way, you cannot Special Summon monsters for the rest of this turn, except "Superheavy Samurai" monsters. You can Tribute this card, then activate 1 of these effects;
● Destroy 1 card in your opponent's Spell & Trap Zone, then you can Set the destroyed Spell/Trap Card on your side of the field.
● Destroy 1 card in your opponent's Pendulum Zone, then you can place the destroyed card in your Pendulum Zone.

Gains 100 ATK for each face-down card in your Extra Deck. You can only use each of the following effects of "Dreaming Reality of Nemleria, Realized" once per turn. If this card is in your hand: You can target 1 monster you control; place it on the bottom of the Deck, and if you do, Special Summon this card. If this card is Special Summoned: You can activate 1 of these effects;
● Add 1 "Dreaming Nemleria" from your Deck to your face-up Extra Deck.
● Change 1 other face-up monster on the field to face-down Defense Position.

You can banish this card from your Graveyard to activate 1 of these effects;
● Increase the Levels of all "Mermail" monsters you currently control by 1.
● Increase the Levels of all "Mermail" monsters you currently control by 2.

Once per turn, during either player's turn: You can discard 1 "Ninja" monster, then activate 1 of these effects;
● This turn, "Ninja" monsters and "Ninjitsu Art" cards you control cannot be destroyed by battle or card effects.
● 1 "Ninja" monster you control gains 1000 ATK until the end of this turn.

Cannot be Special Summoned. When this card is Normal Summoned: You can target 1 of your banished Level 4 or lower "Blackwing" monsters; Special Summon it in Defense Position. You can banish this card from the GY to activate 1 of the following effects;
● Place Black Feather Counter(s) on 1 "Black-Winged Dragon" you control, equal to the number of card(s) your opponent controls.
● Place 1 Wedge Counter on each face-up monster your opponent controls that does not have one.

Activate 1 of these effects;
● All monsters your opponent controls lose 500 ATK for each Ritual Monster on the field, until the end of this turn.
● Ritual Summon 1 "Megalith" Ritual Monster from your Deck in Defense Position, by Tributing monsters from your hand or field whose total Levels equal exactly twice its Level.

Activate 1 of these effects;
● Gain 1200 LP.
● Inflict 800 damage to your opponent.

Once per turn: You can target 1 Ritual Monster you control; show 1 Ritual Monster in your hand, until the end of this turn. The Level of the shown Ritual Monster becomes the targeted monster's Level, until the end of this turn (even if this card leaves the field). Once per turn, if "Ruin, Queen of Oblivion" or "Demise, King of Armageddon" is Ritual Summoned to your field (except during the Damage Step): You can activate 1 of these effects;
● Draw 1 card.
● Destroy 1 card on the field.

Once per turn: You can Ritual Summon 1 WIND Ritual Monster from your Deck, by Tributing Spirit monsters and/or "Shinobird Token(s)" from your field, whose total Levels equal or exceed the Ritual Monster's Level. Twice per turn, if a face-up WIND monster(s) you control is returned to your hand (except during the Damage Step): You can activate 1 of these effects;
● Add 1 of your Spirit monsters or Ritual Spells that is banished or in your GY to your hand.
● Set 1 "Stars Align across the Milky Way" directly from your Deck.

If you control "Jinzo": Activate 1 of these effects;
● All Machine monsters you currently control cannot be destroyed by your opponent's card effects, until the end of this turn.
● When a card or effect is activated that targets a Machine monster(s) you control: Negate that effect.

If you control a Dragon monster: Activate 1 of these effects;
● Inflict 800 damage to your opponent.
● Target 1 monster with 800 or less DEF; destroy that target.

Once per turn, when an opponent's monster declares an attack: You can send 1 face-down card you control to the GY; destroy that opponent's monster. Once per turn: You can activate 1 of these effects;
● Set to your Spell & Trap Zone as Spells, up to 2 monsters from your hand, Deck, face-up Monster Zone, and/or GY that have "Toy" in their original names and an effect to Set themselves in the Spell & Trap Zone as a Spell.
● Destroy up to 2 cards in your Spell & Trap Zone.

Activate 1 of these effects;
● If you control an "Odd-Eyes" card: Target 1 card on the field; destroy it.
● Add to your hand, 1 Level 7 "Odd-Eyes" monster from your Deck, or 1 face-up Level 7 "Odd-Eyes" Pendulum Monster from your Extra Deck.

Target 1 "Amazement" monster you control or 1 face-up monster your opponent controls; equip this card to it. You can apply the following effect, based on which player controls the equipped monster;
● You: The equipped monster gains 500 ATK. If it would be destroyed by battle or card effect, you can send this card to the GY instead.
● Your opponent: The equipped monster loses 500 ATK for each of your "Attraction" Traps equipped to a monster(s).

Once per turn: You can activate 1 of these effects (but you can only use each effect of "Eternal Favorite" once per turn);
● Special Summon 1 of your "Yubel" monsters that is banished or in your GY. Neither player can activate cards or effects when that monster is Special Summoned.
● If you control "Yubel": Discard 1 card and send this face-up card to the GY; Fusion Summon 1 Fusion Monster from your Extra Deck, using monsters from either field as material, including a "Yubel" monster.

You can only use 1 "Exchange of Night and Day" effect per turn, and only once that turn. You can activate 1 of these effects;
● Send 1 LIGHT Warrior-Type monster from your hand to the Graveyard, then add 1 DARK Warrior-Type monster from your Deck to your hand, with the same Level the sent monster had in your hand.
● Send 1 DARK Warrior-Type monster from your hand to the Graveyard, then add 1 LIGHT Warrior-Type monster from your Deck to your hand, with the same Level the sent monster had in your hand.

Activate 1 of these effects;
● Add 1 Wyrm monster from your Deck to your hand.
● Send any number of Wyrm monsters from your hand and/or face-up from your field to the GY; draw cards equal to the number of monsters you sent to the GY +1.

When an opponent's monster declares an attack: Activate 1 of these effects;
● Banish 1 "D/D/D" monster from your Graveyard, and if you do, the attacking monster loses ATK equal to the banished monster's ATK.
● Add 1 Level 4 or lower "D/D" Pendulum Monster from your Deck to your hand.

Once per turn, if a card in the Monster Zone moves to another Monster Zone (except during the Damage Step): You can activate 1 of these effects;
● Level 5 or higher "Vaylantz" monsters you currently control gain 1200 ATK until the end of this turn.
● Send this face-up card from the Spell & Trap Zone to the GY, then target 1 Effect Monster in your opponent's Main Monster Zone; place that opponent's monster face-up as a Continuous Spell in their Spell & Trap Zone in its same column. (If the zone is occupied, destroy the occupying card.)

When a Spell/Trap Card, or monster effect, that targets exactly 1 "Graydle" monster you control (and no other cards) is activated: Activate 1 of these effects;
● The activated effect becomes "Destroy that monster".
● Negate the activation, and if you do, destroy that card.
